import React from 'react';

const Contact = () => {
  return (
    <section className='px-10'>
        <div className='text-8xl px-96 textflex'>Hi there! Can't find what you need?</div>
        <div className='text-base'>Please get in touch and our support team will answer all your questions. <br/>You can send a message to <span>neurox.co.uk</span></div>
    </section>
  )
}

export default Contact
